import React from 'react';
import JoelHilton from './JoelHiltonHeadshot.jpg';

const Home = () => {
    return (
        <div className="container">
            <h1>Welcome to Joel's Movie Collection website!</h1>
            <img src={JoelHilton} alt="Joel Hilton" />
            <p>
                This website is meant to pay homage to Joel Hilton and his
                wonderful movie knowledge.
            </p>
            <p>
                Make sure to navigate around and look at Joel's podcast website
                as well as his movie collection.
            </p>
        </div>
    );
};

export default Home;
